import Typewriter from "typewriter-effect";

function HappyBirthday() {
  return (
    <div className="happy">
      <Typewriter
        onInit={(typewriter) => {
          typewriter
            .typeString("Hello world")
            .pauseFor(1000)
            .deleteAll()
            .typeString("Welcome to typewriter")
            .pauseFor(1000)
            .deleteAll()
            .typeString("My name is Ivan")
            .start();
        }}
      />
    </div>
  );
}

export default HappyBirthday;
